<node CREATED="1402690793318" FOLDED="true" ID="ID_1144474585" MODIFIED="1429355991116" TEXT="About Busybox">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      BusyBox provides several stripped-down Unix tools in a single executable file. It runs in a variety of POSIX environments such as Linux (including Android), FreeBSD[10] and others, such as proprietary kernels, although many of the tools it provides are designed to work with interfaces provided by the Linux kernel. It was specifically created for embedded operating systems with very limited resources. The authors dubbed it "The Swiss Army Knife of Embedded Linux", as the single executable replaces basic functions of more than 300 common commands. It is released as free software under the terms of the GNU General Public License.
    </p>
  </body>
</html></richcontent>
