<node CREATED="1407971576773" ID="ID_440400083" MODIFIED="1408917148745" TEXT="About MirOS BSD">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      MirOS is an operating system based on OpenBSD and synchronised with the ongoing development of its parent. The most important differences between OpenBSD and MirOS include a completely rewritten bootloader and boot manager, a slim base system without NIS, Kerberos, BIND and i18n, binary security updates for stable releases, and current versions of the GNU developer toolchain.&#xa0;
    </p>
  </body>
</html></richcontent>
