<node CREATED="1401998911457" ID="ID_777975865" MODIFIED="1403966266567" TEXT="About PC-BSD">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      PC-BSD has as its goals to be an easy-to-install-and-use desktop operating system, based on FreeBSD. To accomplish this, it provides a graphical installation to enable even UNIX novices to easily install and get it running. It pre-configures KDE, video, sound, and networking so that the desktop can be used immediately. A graphical software installation program makes installing pre-built software, known as Push Button Installers (PBI), as easy as other popular operating systems.&#xa0;
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=pcbsd
    </p>
  </body>
</html></richcontent>
<font BOLD="true" NAME="SansSerif" SIZE="12"/>
</node>
