<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      FreeNAS is a tiny FreeBSD-based operating system which provides free Network-Attached Storage (NAS) services (CIFS, FTP and NFS).&#160;
    </p>
