<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Manjaro Linux is a fast, user-friendly, desktop-oriented operating system based on Arch Linux. Key features include intuitive installation process, automatic hardware detection, stable rolling-release model, ability to install multiple kernels, special Bash scripts for managing graphics drivers and extensive desktop configurability. Manjaro Linux offers Xfce and Openbox desktops as core options, as well as a minimalist Net edition for more advanced users. Community-supported GNOME 3/Cinnamon and KDE flavours are available. Users also benefit from the supportive and vibrant Manjaro community forum.&#xa0;
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=manjaro
    </p>
  </body>
</html></richcontent>
