<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Arch Linux ARM carries forward the Arch Linux philosophy of simplicity and user-centrism, targeting and accommodatingcompetentLinux users by giving them complete control and responsibility over the system. Instructions are provided to assist in navigating the nuances of installation on the various ARM platforms; however, the system itself will offer little assistance to the user.
    </p>
  </body>
