<node CREATED="1408916227979" FOLDED="true" ID="ID_1262829932" MODIFIED="1429355991135" TEXT="About BlackArch Linux">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      BlackArch Linux is an Arch Linux-based distribution designed for penetration testers and security researchers. It is supplied as a live DVD image that comes with several lightweight window managers, including Fluxbox, Openbox, Awesome and spectrwm. It ships with over a thousand specialist tools for penetration testing and forensic analysis.&#xa0;
    </p>
  </body>
</html></richcontent>
