<node CREATED="1403394013969" FOLDED="true" ID="ID_721042208" MODIFIED="1429355991138" TEXT="About Parabola GNU/Linux">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Parabola GNU/Linux is an unofficial "libre" variant of Arch Linux. It aims to provide a fully free (as in freedom) distribution based on the packages of the Arch Linux project, with packages optimised for i686 and x86_64 processors. The goal is to give the users complete control over their systems with 100% "libre" software. Parabola GNU/Linux is listed by the Free Software Foundation (FSF) as a fully free software distribution.&#xa0;
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=parabola
    </p>
  </body>
</html></richcontent>
