<node CREATED="1407971441542" ID="ID_971964002" MODIFIED="1407971454855" TEXT="About kademar Linux">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      The kademar Linux distribution is a complete desktop Linux operating system based on Debian GNU/Linux. Compared to its parent, it includes more intuitive system management and better hardware support, including support for Bluetooth, WiFi, ACPI power management, NTFS, Lightscribe, USB, web cams, TDT/DVB, and other devices. The distribution supports English, Spanish, and Catalan languages and provides separate DVD edition with more applications as well as a light-weight edition for older computers. The distribution also includes a graphical system configuration tool called CADI.&#xa0;
    </p>
  </body>
</html></richcontent>
