<node CREATED="1403553457716" FOLDED="true" ID="ID_119159335" MODIFIED="1429657186837" TEXT="About dynebolic">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      dyne:bolic is a GNU/Linux distribution running from a CD and able to recognise most of your devices and peripherals: sound, video, TV, network cards, firewire, USB devices and more. It is shaped on the needs of media activists, artists and creative individuals, a practical tool for multimedia production. You can manipulate and broadcast both sound and video with tools to record, edit, encode and stream, all using free software!&#xa0;<br/>
    </p>
  </body>
