<node CREATED="1410904277171" FOLDED="true" ID="ID_1221540425" LINK="http://www.hybryde.org/site/index.php" MODIFIED="1429657186859" TEXT="Hybryde Linux">
<node CREATED="1410904300979" ID="ID_1151878451" MODIFIED="1410904318923" TEXT="About Hybryde Linux">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Hybryde Linux is an Ubuntu-based distribution for the desktop. Its most unusual feature is an option to switch rapidly between multiple desktop environments and window manager without logging out - the list includes Enlightenment 17, GNOME 3 (GNOME Shell and GNOME 3 &quot;Fallback&quot; mode), KDE, LXDE, Openbox, Unity, Xfce and FVWM. This is achieved via a highly customisable Hy-menu, which also allows launching applications and configuring the system. All open applications are carried to any of the available desktops. The system offers an interesting way to work fluidly in a multi-desktop environment.
    </p>
  </body>
</html></richcontent>
<font BOLD="true" NAME="SansSerif" SIZE="12"/>
</node>
