<node CREATED="1410199074120" ID="ID_1883924505" MODIFIED="1410199090275" TEXT="About ZevenOS">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      ZevenOS is an Ubuntu-based GNU/Linux distribution with focus on providing a fast and easy-to-use system with BeOS-like user interface and support for older hardware. The distribution is built on top of a recent Linux kernel and includes a large number of popular open-source software applications for office use, multimedia playback and software development. ZevenOS also ships with MAGI, a tool for starting applications and managing the system. The project's "Neptune" edition is a separate built based on Debian GNU/Linux and featuring the latest KDE desktop.&#xa0;
    </p>
  </body>
</html></richcontent>
