<node CREATED="1434005723639" ID="ID_1310714938" MODIFIED="1434005734007" TEXT="info">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Ubuntu MATE is a desktop Linux distribution which aims to bring the simplicity and elegance of the Ubuntu operating system through a classic, traditional desktop environment - the MATE desktop. MATE is the continuation of the GNOME 2 desktop environment which was used as Ubuntu's default desktop until 10.10 (when it was replaced by Unity). The project began its life as an Ubuntu &quot;remix&quot;, but starting with version 15.04, it was formally accepted as an official member of the Ubuntu family of Linux distributions.
    </p>
  </body>
</html></richcontent>
