<node CREATED="1411080683952" FOLDED="true" ID="ID_348991475" MODIFIED="1429657186884" TEXT="About Astrunix">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Asturix is a desktop-oriented Linux distribution based on Ubuntu. Some of its features include easy-to-use design, integration of social and micro-blogging networks, integration of popular web-based applications, and ability to legally download and play music via Jamendo.com's free download service.
    </p>
    <p>
      
    </p>
    <p>
      Afterstopping all development of the OS, we moved on to new challenges.
    </p>
    <p>
      We believe that nowadaysfree cultureshould be pushed forward as hard as possible.
    </p>
    <p>
      And we will do so. We will announce something to achieve it in the following months.
    </p>
    <p>
      Also, thanks to all the expertise that our years developing the OS brought us, we offer advanced software consulting.
    </p>
    <p>
      We are focusing on high-scalability web applications and enterprise free software solutions.
    </p>
  </body>
</html></richcontent>
