<node CREATED="1402007594337" ID="ID_1611376449" MODIFIED="1403133006058" TEXT="About Xubuntu">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Xubuntu is a Linux distribution based on Ubuntu. Unlike its parent, however, Xubuntu uses the light-weight Xfce desktop environment and is optimised for lower-end machines. The distribution includes only GTK+ applications where possible.&#xa0;
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=xubuntu
