<node CREATED="1402007594337" FOLDED="true" ID="ID_1844049999" MODIFIED="1429657186890" TEXT="About Lubuntu">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Lubuntu is a fast, lightweight and energy-saving variant of Ubuntu using the LXDE (Lightweight X11 Desktop Environment) desktop. It is intended to have low-resource system requirements and is designed primarily for netbooks, mobile devices and older PCs.&#160;
    </p>
    <p>
      
    </p>
