<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      LXLE is an easy-to-use lightweight desktop Linux distribution based on Lubuntu and featuring the LXDE desktop environment. Compared to its parent, LXLE has a number of unique characteristics: it is built from Ubuntu's LTS (long-term support) releases, it covers most users' everyday needs by providing a good selection of default applications, and it adds useful modifications and tweaks to improve performance and functions.&#160;
    </p>
  </body>
</html></richcontent>
