    <p>
      CAELinux is a live DVD Linux distribution dedicated to computer-aided engineering (CAD) and finite element analysis. Based on Ubuntu, it features a full software solution for professional 3D FE analysis from CAD geometry. It includes the Salome 3D pre/post processor, Code_Aster non-linear/multi- physics FE solver, Code-Saturne and OpenFOAM CFD solvers, Elmer multiphysics suite, GMSH, Netgen and enGrid 3D meshers, GNU Octave, Rkward, wxMaxima, Scilab, and more.&#160;
