  <body>
    <p>
      DreamStudio is an Ubuntu-based distribution containing tools to create stunning graphics, captivating videos, inspiring music, and professional websites. Some of the included and pre-configured applications include Cinelerra (a powerful non-linear video editor), Ardour (a professional digital audio workstation), CinePaint (a tool for motion picture frame-by-frame retouching), Blender (a 3D graphics application), Inkscape (a vector graphics editor), Synfig Studio (a vector-based 2D animation software), Kompozer (a complete web authoring system), and many others.&#xa0;
