<node CREATED="1407877576744" ID="ID_1191683630" MODIFIED="1407877592950" TEXT="About 2XOS">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      2XOS is a Debian-based GNU/Linux distribution with a small footprint, optimised for remote desktop computing. It features auto-detection capabilities similar to KNOPPIX. It boots directly to a login manager which, when coupled with the 2X Remote Application Server, redirects users to a remote RDP/ICA/NX desktop. The distribution can be booted via PXE, CD or installed to a hard disk or flash disk. Updates to the distribution are managed through the 2X Remote Application Server web interface. 2XOS requires 2X Remote Application Server to boot up; 2X Remote Application Server is a commercial product, though it is free for up to five thin clients. 2X Software is a company providing virtual desktop, application delivery and mobile device management solutions. It offers a range of solutions to make every organisation's shift to cloud computing simple and affordable.&#xa0;
    </p>
  </body>
</html></richcontent>
