<node CREATED="1413398891045" FOLDED="true" ID="ID_612843144" MODIFIED="1429355991188" TEXT="About Emdebian Grip">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Emdebian Gripis a small-footprintLinux distributionbased on and compatible withDebian. When compared to Debian, it provides a more fine-grained control over thepackageselection, size, dependencies and content, in order to enable creation of small and efficient Debian packages for use on resource-limitedembedded systems. Reduced installation size is one of the main benefits coming from the Emdebian Grip.
    </p>
  </body>
</html></richcontent>
