<node CREATED="1402007594337" ID="ID_558705171" MODIFIED="1402615051448" TEXT="About GALPon MiniNo">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      GALPon MiniNo is a lightweight, Debian-based distribution designed for PCs that are 10 years old (or more), though it's also perfectly usable on modern computers and netbooks. It contains a carefully tuned selection of applications that try to maintain a balance between features, ease of use and speed. IceWM with ROX-Filer and PCManFM provides the desktop. The distribution has full support for three languages (English, Galician and Spanish) and it also comes with "magic icons" - a set of tools that automate repetitive or system tasks (e.g. rotate or resize hundreds of digital images, convert audio or video files into other formats or burn an audio CD with a simple drag &amp; drop).&#xa0;
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=minino
    </p>
  </body>
</html></richcontent>
