<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Ubuntu Privacy Remix (UPR) is a modified live DVD based on Ubuntu. Its goal is to provide a completely isolated working environment where private data can be dealt with safely and to protect data against unsolicited access. Networking is intentionally disabled and saving data to mounted volumes is not allowed. The live CD is not installable to hard disk.&#xa0;
