<node CREATED="1439445126402" ID="ID_1188857489" MODIFIED="1439445138804" TEXT="info">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Whonix is an anonymous general purpose operating system based on VirtualBox, Debian GNU/Linux, Tor, and optionally I2P. By Whonix design, IP and DNS leaks are impossible. Not even malware as superuser can find out the user's real IP address/location. This is because Whonix consists of two (virtual) machines. One machine solely runs Tor and acts as a gateway, called Whonix-Gateway. The other machine, called Whonix-Workstation, is on a completely isolated network. Only connections through Tor are possible.
    </p>
  </body>
</html></richcontent>
