<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Elive, or Enlightenment live CD, is a Debian-based desktop Linux distribution and live CD featuring the Enlightenment window manager. Besides being pre-configured and ready for daily desktop use, it also includes "Elpanel" - a control centre for easy system and desktop administration. Elive is a commercial distribution; while the live CD is available as a free download, those wishing to install it to a hard disk are asked to pay US$15 for an installation module.&#xa0;
    </p>
  </body>
</html></richcontent>
