  <body>
    <p>
      <b>About antiX</b><img src="../icons/open_source.png" />
    </p>
  </body>
</html></richcontent>
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      antiX is a fast, lightweight and easy-to-install Linux live CD distribution based on Debian's "Testing" branch for x86 compatible systems. antiX offers users the "antiX Magic" in an environment suitable for old computers. The goal of antiX is to provide a light, but fully functional and flexible free operating system for both newcomers and experienced users of Linux. It should run on most computers, ranging from 64 MB old PII 266 systems with pre-configured 128 MB swap to the latest powerful boxes. 128 MB RAM is recommended minimum for antiX. The installer needs minimum 2.2 GB hard disk size. antiX can also be used as a fast-booting rescue CD.&#xa0;
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=antix
    </p>
  </body>
