<node CREATED="1403554761050" ID="ID_1361826242" MODIFIED="1403554779698" TEXT="About Skolelinux">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Skolelinux is the Debian-edu project's Custom Debian Distribution (CDD) in development. It is aiming to provide an out-of-the-box localised environment tailored for schools and universities. The out-of-the-box environment comes with 75 applications aimed at schools, as well as 15 network services pre-configured for a school environment. The simple, three-question installation requires minimal technical knowledge. Skolelinux is Debian, which means, among other things, that there are no license costs or worries, and that upgrade and maintenance of the software can be done over the Internet with the power of Debian's apt-get. The core goals of Skolelinux are localisation and ease of system administration.&#xa0;
    </p>
