<node CREATED="1408921279540" ID="ID_519825508" MODIFIED="1408921319624" TEXT="About Volumio">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Volumio (formerly RaspyFi) is a Debian-based distribution originally made for the Raspberry Pi single-board computer, but later expanded to other embedded devices, including CuBox, BeagleBone Black and UDOO. It aims to fully integrate Music Player Daemon, an open-source music player server, into the current Debian releases and to optimise it for Audiophile-quality music playback. Volumio also makes it simple to play music library directly from a USB storage device or from any network-attached storage and it also enables users to listen to web-based radio stations from Spotify, Last.fm and SoundCloud.&#xa0;
    </p>
  </body>
</html></richcontent>
