<node CREATED="1403909125508" ID="ID_801510852" MODIFIED="1409688850427" TEXT="About Vyatta">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Vyatta software is a complete, ready-to-use, Debian-based distribution that is designed to transform standard x86 hardware into an enterprise-class router / firewall. Vyatta software includes support for commonly used network interfaces, and industry-standard routing protocols and management protocols. Unlike previous open-source routing projects, all these features are configurable via a single command-line interface (CLI) or web-based graphical user interface (GUI). Vyatta software is available as a free Community Edition as well as tiered Software Subscriptions that include maintenance, upgrades and support.&#xa0;
    </p>
    <p>
      
    </p>
