<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Neptune is a GNU/Linux distribution for desktops. It is based on Debian's stable branch, except for a newer kernel, some drivers and newer versions of popular applications, such as LibreOffice. It also ships with the latest version of the KDE desktop. The distribution's main goals are to provide a good-looking general-purpose desktop with pre-configured multimedia playback and to offer an easy-to-use USB installer with a persistence option.&#xa0;
    </p>
  </body>
