<node CREATED="1407878105461" ID="ID_992389787" MODIFIED="1407878123405" TEXT="About Epidemic GNU/Linux">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Epidemic GNU/Linux is a Brazilian desktop Linux distribution based on Debian GNU/Linux. Its main features are the KDE desktop, easy-to-use installer, 3D desktop features with CompizFusion, use of the GFXBoot bootloader, out-of-the-box support for numerous proprietary and non-free kernel drivers, and support for a variety of media codecs.&#xa0;
    </p>
  </body>
</html></richcontent>
