<node CREATED="1407877726296" ID="ID_1445389362" MODIFIED="1407877754667" TEXT="About LinEX">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      LinEx is a Linux distribution developed by the Extremadura Regional Government in Spain and CENATIC, the Spanish National Competence Centre for the Application of Open-Source Technologies. LinEx is based on Debian GNU/Linux, a distribution that, thanks to its design, makes it easy to create other distributions that can inherit its advantages and get rid of some of its disadvantages (for example, the difficulty of setup and configuration). By using a modified Debian distribution, the Extremadura Regional Government has benefited from the fact that there is a large amount of varied software for it.&#xa0;
    </p>
  </body>
</html></richcontent>
