<node CREATED="1402007594337" FOLDED="true" ID="ID_1298553166" MODIFIED="1429355991210" TEXT="About Clonezilla Live">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Clonezilla Live is a Debian-based live CD containing Clonezilla, a partition and disk cloning software similar to Norton Ghost. It saves and restores only used blocks in hard drive. With Clonezilla, one can clone a 5 GB system to 40 clients in about 10 minutes.&#xa0;
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=clonezilla
    </p>
  </body>
</html></richcontent>
