<node CREATED="1403556400750" FOLDED="true" ID="ID_1546420171" MODIFIED="1429355991211" TEXT="About siduction">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      The siduction distribution is a desktop-oriented operating system and live medium based on the "unstable" branch of Debian GNU/Linux. Forked from aptosid in late 2011, siduction offers three separate live media with KDE, LXDE and Xfce desktops. The project also promises regular releases, an open development model, and friendly relationship with its developer and user community.&#xa0;
    </p>
  </body>
</html></richcontent>
