<node CREATED="1403556672108" FOLDED="true" ID="ID_1490662548" MODIFIED="1429355991211" TEXT="About aptosid">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      The aptosid distribution is a desktop-oriented operating system and live CD based on the unstable branch of Debian GNU/Linux. Besides full compatibility with its parent, the distribution also offers a custom kernel with support for a wide variety of modern hardware devices, KDE as the default desktop environment, a rolling release cycle, and compliance with Debian's Free Software guidelines.&#xa0;<br/>
    </p>
  </body>
</html></richcontent>
