<node CREATED="1403964380869" ID="ID_1929784696" MODIFIED="1403964401537" TEXT="About LinuxBBQ">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      LinuxBBQ is a multi-purpose operating system based on Debian's "unstable" branch and spiced up with kernels and tools from siduction, Grml and Linux Mint. LinuxBBQ offers different flavours and desktops which are released as "editions" (with no version numbers) and which can be customised and remixed by the user. The individual editions are built to include most major desktop environments (with the exception of GNOME) and there is a special edition offering a choice of no fewer than 53 window managers - everything from aewm to xmonad.&#xa0;
    </p>
  </body>
</html></richcontent>
