<node CREATED="1408123572027" FOLDED="true" ID="ID_1493634818" MODIFIED="1429355991213" TEXT="About SymphonyOS">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      SymphonyOS is a Ubuntu-based desktop Linux distribution featuring a custom-built desktop environment called "Mezzo". Written in Perl and Gtk2::Webkit, Mezzo uses the lightweight but highly configurable FVWM window manager to create an unusual and eye-catching desktop user interface with focus on simplicity and usability.&#xa0;
    </p>
  </body>
</html></richcontent>
