<node CREATED="1402960441218" FOLDED="true" ID="ID_876164066" MODIFIED="1429355991216" TEXT="About Sabayon Linux">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Sabayon Linux is a Gentoo-based distribution which follows the works-out-of-the-box philosophy, aiming to give the user a wide number of applications that are ready for use and a self-configured operating system. Sabayon offers the user an easy-to-use workspace with a captivating look, good hardware detection and a large number of up-to-date software packages installed by default, with additional software available from a repository. Sabayon is available in several flavors featuring respectively the KDE, GNOME, LXDE, Xfce and Enlightenment desktop environments.&#xa0;
    </p>
    <p>
      
    </p>
