<node CREATED="1411243673457" ID="ID_1178732917" MODIFIED="1411244111073" TEXT="About Pirate Linux">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p http-equiv="content-type" content="text/html; charset=utf-8" style="margin-top: 0px; letter-spacing: normal; text-align: start; margin-bottom: 0; font-style: normal; font-weight: normal; padding-top: 0px; border-top-width: 0px; white-space: normal; border-bottom-style: none; word-spacing: 0px; color: rgb(68, 68, 68); border-left-style: none; text-indent: 0px; padding-bottom: 0px; border-right-style: none; vertical-align: baseline; border-right-width: 0px; text-transform: none; background-color: rgb(255, 255, 255); border-top-style: none; padding-left: 0px; line-height: 21px; padding-right: 0px; font-family: Arial, Helvetica, sans-serif; margin-left: 0px; margin-right: 0px; border-bottom-width: 0px; border-left-width: 0px; font-size: 14px; font-variant: normal">
      Pirate Linux is a Gentoo Linux-based operating system created by a few members of the Pirate Party of Canada. The main goals are:
    </p>
    <p http-equiv="content-type" content="text/html; charset=utf-8" style="margin-top: 0px; letter-spacing: normal; text-align: start; margin-bottom: 0; font-style: normal; font-weight: normal; padding-top: 0px; border-top-width: 0px; white-space: normal; border-bottom-style: none; word-spacing: 0px; color: rgb(68, 68, 68); border-left-style: none; text-indent: 0px; padding-bottom: 0px; border-right-style: none; vertical-align: baseline; border-right-width: 0px; text-transform: none; background-color: rgb(255, 255, 255); border-top-style: none; padding-left: 0px; line-height: 21px; padding-right: 0px; font-family: Arial, Helvetica, sans-serif; margin-left: 0px; margin-right: 0px; border-bottom-width: 0px; border-left-width: 0px; font-size: 14px; font-variant: normal">
      
    </p>
    <p http-equiv="content-type" content="text/html; charset=utf-8" style="margin-top: 0px; letter-spacing: normal; text-align: start; margin-bottom: 0; font-style: normal; font-weight: normal; padding-top: 0px; border-top-width: 0px; white-space: normal; border-bottom-style: none; word-spacing: 0px; color: rgb(68, 68, 68); border-left-style: none; text-indent: 0px; padding-bottom: 0px; border-right-style: none; vertical-align: baseline; border-right-width: 0px; text-transform: none; background-color: rgb(255, 255, 255); border-top-style: none; padding-left: 0px; line-height: 21px; padding-right: 0px; font-family: Arial, Helvetica, sans-serif; margin-left: 0px; margin-right: 0px; border-bottom-width: 0px; border-left-width: 0px; font-size: 14px; font-variant: normal">
      Educate the public about Pirate Party issues, and learn from their feedback.
    </p>
    <p http-equiv="content-type" content="text/html; charset=utf-8" style="margin-top: 0px; letter-spacing: normal; text-align: start; margin-bottom: 0; font-style: normal; font-weight: normal; padding-top: 0px; border-top-width: 0px; white-space: normal; border-bottom-style: none; word-spacing: 0px; color: rgb(68, 68, 68); border-left-style: none; text-indent: 0px; padding-bottom: 0px; border-right-style: none; vertical-align: baseline; border-right-width: 0px; text-transform: none; background-color: rgb(255, 255, 255); border-top-style: none; padding-left: 0px; line-height: 21px; padding-right: 0px; font-family: Arial, Helvetica, sans-serif; margin-left: 0px; margin-right: 0px; border-bottom-width: 0px; border-left-width: 0px; font-size: 14px; font-variant: normal">
      Create a unified platform that Pirate Party members can use for further developments as well as communication &amp; meetings.
    </p>
    <p http-equiv="content-type" content="text/html; charset=utf-8" style="margin-top: 0px; letter-spacing: normal; text-align: start; margin-bottom: 0; font-style: normal; font-weight: normal; padding-top: 0px; border-top-width: 0px; white-space: normal; border-bottom-style: none; word-spacing: 0px; color: rgb(68, 68, 68); border-left-style: none; text-indent: 0px; padding-bottom: 0px; border-right-style: none; vertical-align: baseline; border-right-width: 0px; text-transform: none; background-color: rgb(255, 255, 255); border-top-style: none; padding-left: 0px; line-height: 21px; padding-right: 0px; font-family: Arial, Helvetica, sans-serif; margin-left: 0px; margin-right: 0px; border-bottom-width: 0px; border-left-width: 0px; font-size: 14px; font-variant: normal">
      Create a system that Pirate Party members will want to use for themselves.
    </p>
    <p http-equiv="content-type" content="text/html; charset=utf-8" style="margin-top: 0px; letter-spacing: normal; text-align: start; margin-bottom: 0; font-style: normal; font-weight: normal; padding-top: 0px; border-top-width: 0px; white-space: normal; border-bottom-style: none; word-spacing: 0px; color: rgb(68, 68, 68); border-left-style: none; text-indent: 0px; padding-bottom: 0px; border-right-style: none; vertical-align: baseline; border-right-width: 0px; text-transform: none; background-color: rgb(255, 255, 255); border-top-style: none; padding-left: 0px; line-height: 21px; padding-right: 0px; font-family: Arial, Helvetica, sans-serif; margin-left: 0px; margin-right: 0px; border-bottom-width: 0px; border-left-width: 0px; font-size: 14px; font-variant: normal">
      Help people have easy access to a transparent system that allows them to exercise a strong level of free speech and privacy.
    </p>
    <p http-equiv="content-type" content="text/html; charset=utf-8" style="margin-top: 0px; letter-spacing: normal; text-align: start; margin-bottom: 0; font-style: normal; font-weight: normal; padding-top: 0px; border-top-width: 0px; white-space: normal; border-bottom-style: none; word-spacing: 0px; color: rgb(68, 68, 68); border-left-style: none; text-indent: 0px; padding-bottom: 0px; border-right-style: none; vertical-align: baseline; border-right-width: 0px; text-transform: none; background-color: rgb(255, 255, 255); border-top-style: none; padding-left: 0px; line-height: 21px; padding-right: 0px; font-family: Arial, Helvetica, sans-serif; margin-left: 0px; margin-right: 0px; border-bottom-width: 0px; border-left-width: 0px; font-size: 14px; font-variant: normal">
      Give people access to useful open source content such as books, videos, software.
    </p>
    <p http-equiv="content-type" content="text/html; charset=utf-8" style="margin-top: 0px; letter-spacing: normal; text-align: start; margin-bottom: 0; font-style: normal; font-weight: normal; padding-top: 0px; border-top-width: 0px; white-space: normal; border-bottom-style: none; word-spacing: 0px; color: rgb(68, 68, 68); border-left-style: none; text-indent: 0px; padding-bottom: 0px; border-right-style: none; vertical-align: baseline; border-right-width: 0px; text-transform: none; background-color: rgb(255, 255, 255); border-top-style: none; padding-left: 0px; line-height: 21px; padding-right: 0px; font-family: Arial, Helvetica, sans-serif; margin-left: 0px; margin-right: 0px; border-bottom-width: 0px; border-left-width: 0px; font-size: 14px; font-variant: normal">
      Remove peoples&#8217; dependence on copyrighted &#8220;content&#8221;.
    </p>
    <p http-equiv="content-type" content="text/html; charset=utf-8" style="margin-top: 0px; letter-spacing: normal; text-align: start; margin-bottom: 0; font-style: normal; font-weight: normal; padding-top: 0px; border-top-width: 0px; white-space: normal; border-bottom-style: none; word-spacing: 0px; color: rgb(68, 68, 68); border-left-style: none; text-indent: 0px; padding-bottom: 0px; border-right-style: none; vertical-align: baseline; border-right-width: 0px; text-transform: none; background-color: rgb(255, 255, 255); border-top-style: none; padding-left: 0px; line-height: 21px; padding-right: 0px; font-family: Arial, Helvetica, sans-serif; margin-left: 0px; margin-right: 0px; border-bottom-width: 0px; border-left-width: 0px; font-size: 14px; font-variant: normal">
      Teach people how the technology (used in the OS) works.
    </p>
