<node CREATED="1411320276989" ID="ID_1613072593" MODIFIED="1411320293809" TEXT="About IPCop Firewall">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      IPCop Linux is a complete Linux Distribution whose sole purpose is to protect the networks it is installed on. After seeing the direction certain Linux Distributions were heading in, a group of dissatisfied users/developers decided that there was little reason for the idea of a GPL Linux Firewall Distribution of such potential to be, simply, extinguished. By implementing existing technology, outstanding new technology and secure programming practices IPCop is the Linux Distribution for those wanting to keep their computers/networks safe. The IPCop Linux Team is dedicated to doing the very best job possible to keep your systems safe, as you can see on our site. &quot;The Bad Packets Stop Here!&quot;
    </p>
  </body>
</html></richcontent>
