<node CREATED="1409685144039" ID="ID_251657159" MODIFIED="1411320008725" TEXT="SENTIX">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      SENTINIX is an operating system (or a so called Linux distribution) designed for monitoring, auditing, intrusion detection and anti-spam. It's completely free; free to use, free to modify and free to distribute. SENTINIX includes the following software installed and pre-configured; Nagios, Nagat, Snort, SnortCenter, ACID, Cacti, RRDTool, Nessus, Postfix, MailScanner, SpamAssassin, openMosix, MySQL, Apache, PHP, Perl, Python and lots more. SENTINIX is shipped with a lot of programs, not all licensed under the same license (e.g. GNU GPL). SENTINIX contains (and will only contain) software whose license has been approved by the Open Source Initiative. Compledge Sentinel was the predecessor of SENTINIX.&#xa0;
    </p>
  </body>
</html></richcontent>
