<node CREATED="1413498480848" FOLDED="true" ID="ID_966531371" MODIFIED="1429355991225" TEXT="info">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Lighthouse is a quick and easy to set up, full-featured operating system. Derived from PuppyLinux, it offers several media players, GIMP image editing and a choice of window managers. Modular design supports up to 40 concurrent SFS software combo-packs including LIbreOffice, Opera, Wine and VLC. If you have a Lighthouse CD click here to get started or download the latest version here.
    </p>
    <p>
      
    </p>
    <p>
      From the start of Lighthouse Pup in 2007 we've tried to make the software pre-configured and tuned for a pleasant experience, including a variety of popular Linux applications and building on the agility and adaptability of PuppyLinux. The feedback and great ideas on the Puppy forum have really improved and expanded Lighthouse, and I'm grateful for that.
    </p>
  </body>
</html></richcontent>
