<node CREATED="1408125536975" ID="ID_126746459" MODIFIED="1408125553412" TEXT="About RCD">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Rocks is a complete "cluster on a CD" solution for x86 and x86_64 Red Hat Linux clusters. Building a Rocks cluster does not require any experience in clustering, yet a cluster architect will find a flexible and programmatic way to redesign the entire software stack just below the surface (appropriately hidden from the majority of users). Although Rocks includes the tools expected from any clustering software stack (PBS, Maui, GM support, Ganglia, etc), it is unique in its simplicity of installation.&#xa0;
    </p>
  </body>
</html></richcontent>
