<node CREATED="1402007594337" FOLDED="true" ID="ID_1438680499" MODIFIED="1429355991232" TEXT="About BLAG Linux And GNU">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      BLAG is a Linux distribution based on Fedora and reduced to one CD. It includes useful applications missing from Fedora, as well as a suite of graphics, Internet, audio, video, office, and peer-to-peer file sharing applications. BLAG is up-to-date with all Fedora errata fixes at time of release and uses Synaptic for easy upgrades. The name stands for Brixton Linux Action Group, which works to overthrow corporate control of information and technology through community action and to spread Free Software.&#xa0;
    </p>
    <p>
      
    </p>
