  <body>
    <p>
      Berry Linux is a bootable CD Linux with automatic hardware detection and support for many graphics cards, sound cards, SCSI and USB devices and other peripherals. Berry Linux can be used as a Linux demo, educational CD or as a rescue system. It is not necessary to install anything on a hard disk, although this option is also available (it needs 1.2GB of hard disk space). Berry Linux is based on Red Hat Linux and Knoppix.&#xa0;
