<node CREATED="1409603782660" ID="ID_636988826" MODIFIED="1409603797085" TEXT="About OLPC OS">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      One Laptop Per Child (OLPC) is an initiative to build a low-cost laptop computer with a pre-installed operating system and applications designed for children in developing countries. The operating system is a Linux-based solution, a heavily customised edition of Fedora Core with a special graphical user interface called Sugar. Among applications, the system includes a web browser built on Xulrunner, a simple document viewer based on Evince; the AbiWord word processor, an RSS reader, email, chat and VOIP clients, a multimedia authoring and playback environment, a music composition toolkit, graphics toolkits, games, a shell, and a debugger.&#xa0;
    </p>
  </body>
</html></richcontent>
