<node CREATED="1408910085721" FOLDED="true" ID="ID_1318506245" MODIFIED="1429355991237" TEXT="About Qubes OS">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Qubes OS is a security-oriented, Fedora-based desktop Linux distribution whose main concept is &quot;security by isolation&quot; by using domains implemented as lightweight Xen virtual machines. It attempts to combine two contradictory goals: how to make the isolation between domains as strong as possible, mainly due to clever architecture that minimises the amount of trusted code, and how to make this isolation as seamless and easy as possible.
    </p>
  </body>
</html></richcontent>
