<node CREATED="1407108752638" ID="ID_1132654001" MODIFIED="1407108765758" TEXT="About Springdale Linux">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Springdale Linux (formerly PUIAS Linux) is a complete operating system for desktops and servers, built by compiling the source packages for Red Hat Enterprise Linux. Besides these upstream packages, the project also provides several other repositories: "Addons" which contains additional packages not included in a stock Red Hat distribution, "Computational" which carries software specific to scientific computing, and "Unsupported" which holds various experimental packages. The distribution is maintained by the Institute for Advanced Study and Princeton University in the USA.&#xa0;
    </p>
  </body>
</html></richcontent>
