  <body>
    <p>
      Mandriva Linux was launched in 1998 under the name of Mandrake Linux, with the goal of making Linux easier to use for everyone. At that time, Linux was already well-known as a powerful and stable operating system that demanded strong technical knowledge and extensive use of the command line; MandrakeSoft saw this as an opportunity to integrate the best graphical desktop environments and contribute its own graphical configuration utilities to quickly become famous for setting the standard in Linux ease of use. In February 2005, MandrakeSoft merged with Brazil's Conectiva to form Mandriva S.A., with headquarters in Paris, France. The company's flagship product, Mandriva Linux, offers all the power and stability of Linux to both individuals and professional users in an easy-to-use and pleasant environment.&#xa0;
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=mandriva
    </p>
  </body>
</html></richcontent>
