<node CREATED="1402957026141" ID="ID_419293502" MODIFIED="1402957051996" TEXT="About Trinity Rescue Kit">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Trinity Rescue Kit (TRK) is a bootable Linux distribution aimed specifically at offline operations for Windows and Linux systems such as rescue, repair, password resets and cloning. It has custom tools to easily recover deleted files, clone Windows installations over the network, perform antivirus sweeps with two different antivirus products, reset windows passwords, read and write on NTFS partitions, edit partition layout and much much more. Trinity Rescue Kit is mostly based on Mandriva Linux and heavily adapted start-up scripts.&#xa0;
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=trinity
    </p>
  </body>
</html></richcontent>
