<node CREATED="1399319141846" ID="ID_1058665330" LINK="http://linsec.ca/Annvix:Index.htm" MODIFIED="1411245896643" STYLE="fork">
<richcontent TYPE="NODE"><html>
  <head>
    
  </head>
  <body>
    <p>
      <b>Annvix</b>
    </p>
    <p>
      2007 - 2008
    </p>
  </body>
</html></richcontent>
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p http-equiv="content-type" content="text/html; charset=utf-8" style="word-spacing: 0px; margin-left: 0px; font-weight: normal; margin-top: 0; letter-spacing: normal; background-color: rgb(255, 255, 255); text-transform: none; margin-bottom: 0; font-family: sans-serif; white-space: normal; font-variant: normal; color: rgb(0, 0, 0); text-align: start; text-indent: 0px; font-style: normal; line-height: 19.0499992370605px; font-size: 13px; margin-right: 0px">
      Annvix is a free secure Linux-based operating system produced by the Annvix development team andDanen Consulting Services. The Annvix project aims to provide a secure, stable, and fast Linux distribution specifically tailored to servers that provide reliable services such as Email, Web, DNS, FTP, File sharing, and more.
    </p>
    <p style="word-spacing: 0px; margin-left: 0px; font-weight: normal; margin-top: 0; letter-spacing: normal; background-color: rgb(255, 255, 255); text-transform: none; margin-bottom: 0; font-family: sans-serif; white-space: normal; font-variant: normal; color: rgb(0, 0, 0); text-align: start; text-indent: 0px; font-style: normal; line-height: 19.0499992370605px; font-size: 13px; margin-right: 0px">
      The philosophy behind Annvix is security and reliability, and to that end we incorporate projects such as runit for always-on services, socklog for secure and reliable logging, RSBAC for enhanced kernel-level security, and many other custom tools and various software packages. The Annvix footprint is small, a typical default install for a LAMP server is under 400MB in size and every effort is made for the operating system to be lean, use less memory and disk space, to provide maximum functionality and utilize resources without introducing unnecessary bloat.
    </p>
  </body>
</html></richcontent>
