<node CREATED="1402007594337" FOLDED="true" ID="ID_1058972009" MODIFIED="1429355991244" TEXT="About Turbolinux">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Turbolinux distributions are designed from the ground-up specifically for enterprise computing. Turbolinux 7 Server was the first-ever to conform to Internationalization standards to help simplify development of applications that require multiple language support - a critical requirement for software distributed globally. Turbolinux 7 Server also supports the Large File Support (LFS) standard for working with applications that manage or handle up to four terabytes of data - a common requirement for infrastructures serving Fortune 500 and larger companies. Such industrial-strength environments provide the basis upon which PowerCockpit and other Turbolinux innovations were created.&#xa0;
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=turbolinux
