<node CREATED="1402007594337" FOLDED="true" ID="ID_1848173884" MODIFIED="1429355991252" TEXT="info">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      VectorLinux is a small, fast, Intel based Linux operating system for PC style computers. The creators of VectorLinux had a single credo: keep it simple, keep it small and let the end user decide what their operating system is going to be. What has evolved from this concept is perhaps the best little Linux operating system available anywhere. For the casual computer user there is a lightening-fast desktop with graphical programs to handle daily activities from web surfing, sending and receiving email, chatting on IRC to running an FTP server. The power user will be pleased because all the tools are there to compile programs, use the system as a server or perhaps the gateway for home or office computer network. Administrators will be equally pleased because of the small size and memory requirements, so the operating system can be deployed on older machines that have long been forgotten.&#xa0;
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=vector
    </p>
  </body>
</html></richcontent>
