<node CREATED="1402007594337" FOLDED="true" ID="ID_1349642131" MODIFIED="1429355991255" TEXT="About BasicLinux">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      BasicLinux is designed specifically for old PCs. &#xa0;It uses a small kernel and busybox to provide a low-RAM Linux, capable of browsing the web, doing email, and functioning as an X terminal. &#xa0;The current release of BasicLinux is particularly suitable for old laptops -- it has PCMCIA capability and includes MagicPoint (a presentation tool similar to PowerPoint).
    </p>
    <p>
      
    </p>
  </body>
</html></richcontent>
