<node CREATED="1407366127663" ID="ID_440853288" MODIFIED="1407366144303" TEXT="About Superb Mini Server">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Superb Mini Server (SMS) is a Slackware-based server distribution with web, DNS, DHCP, file, print and fax servers, iptables firewall, mail server with spam filter and anti-virus scanner, and BitTorrent station. It also includes Webmin, a web-based administration tool, but no graphical desktop. SMS, which comes with Slackware's text-mode system installer, is built using Linux-Live scripts (from Slax) and can be used as a live CD for testing purposes.&#xa0;
    </p>
  </body>
</html></richcontent>
