<node CREATED="1402699325115" FOLDED="true" ID="ID_1879937567" MODIFIED="1429355991257" TEXT="About Zewalk">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Zenwalk Linux (formerly Minislack) is a Slackware-based GNU/Linux operating system with a goal of being slim and fast by using only one application per task and with focus on graphical desktop and multimedia usage. Zenwalk features the latest Linux technology along with a complete programming environment and libraries to provide an ideal platform for application programmers. Zenwalk's modular approach also provides a simple way to convert Zenwalk Linux into a finely-tuned modern server (e.g. LAMP, messaging, file sharing).&#xa0;
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=Zenwalk
    </p>
  </body>
</html></richcontent>
