<node COLOR="#fa0000" CREATED="1409334721593" FOLDED="true" ID="ID_456097542" MODIFIED="1429355991260" TEXT="~ discontinued">
<node CREATED="1404235635725" ID="ID_153887388" MODIFIED="1431174047403">
<richcontent TYPE="NODE"><html>
  <head>
    
  </head>
  <body>
    <p>
      <b>Jurix</b>
    </p>
    <p>
      1993
    </p>
  </body>
</html></richcontent>
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <h1 content="text/html; charset=utf-8" http-equiv="content-type" style="font-variant: normal; text-transform: none; white-space: normal; word-spacing: 0px; letter-spacing: normal; text-indent: 0px; text-align: start; font-family: Times New Roman; line-height: normal; color: rgb(0, 0, 0); font-style: normal">
      <font size="3" face="SansSerif">History of Jurix </font>
    </h1>
    <p style="font-variant: normal; text-transform: none; font-weight: normal; white-space: normal; word-spacing: 0px; letter-spacing: normal; text-indent: 0px; text-align: start; font-family: Times New Roman; line-height: normal; color: rgb(0, 0, 0); font-size: medium; font-style: normal">
      <font size="3" face="SansSerif">Jurix started in 1993 and is thus one of the oldest Linux distributions. It started with three floppy disks and it didn't take much time until I needed five of them. </font>
    </p>
    <p style="font-variant: normal; text-transform: none; font-weight: normal; white-space: normal; word-spacing: 0px; letter-spacing: normal; text-indent: 0px; text-align: start; font-family: Times New Roman; line-height: normal; color: rgb(0, 0, 0); font-size: medium; font-style: normal">
      <font size="3" face="SansSerif">At that time the Linux community wasn't too big and many source packages still needed lots of changes (and hacks) to work on Linux. Many source packages were distributed with a special Linux version of them as the original authors didn't use Linux yet. </font>
    </p>
    <p style="font-variant: normal; text-transform: none; font-weight: normal; white-space: normal; word-spacing: 0px; letter-spacing: normal; text-indent: 0px; text-align: start; font-family: Times New Roman; line-height: normal; color: rgb(0, 0, 0); font-size: medium; font-style: normal">
      <font size="3" face="SansSerif">From the very beginning, I separated the Linux changes from the unmodified source packages and tried my best to improve many source packages and special Linux changes. /usr/bin/pkgpack was my very first shell script and it helped me collecting the necessary changes to the original unmodified source code. </font>
    </p>
    <p style="font-variant: normal; text-transform: none; font-weight: normal; white-space: normal; word-spacing: 0px; letter-spacing: normal; text-indent: 0px; text-align: start; font-family: Times New Roman; line-height: normal; color: rgb(0, 0, 0); font-size: medium; font-style: normal">
      <font size="3" face="SansSerif">The NetKits are another result of my separation of the unmodified sources from the necessary Linux changes. I have also spend some more work on the shadow sources (as jurix used them right from the beginning) and on the dialog program. </font>
    </p>
    <p style="font-variant: normal; text-transform: none; font-weight: normal; white-space: normal; word-spacing: 0px; letter-spacing: normal; text-indent: 0px; text-align: start; font-family: Times New Roman; line-height: normal; color: rgb(0, 0, 0); font-size: medium; font-style: normal">
      <font size="3" face="SansSerif">In 1994 I installed the server www.jura.uni-sb.de with my Linux distro and also several client machines, so that any student could choose between Windows and Linux to browse the Internet or write Email. The client machines used bootp for their network settings and had about 70 MB of locally installed software. Just enough for X11 and the necessary client tools. </font>
    </p>
    <p style="font-variant: normal; text-transform: none; font-weight: normal; white-space: normal; word-spacing: 0px; letter-spacing: normal; text-indent: 0px; text-align: start; font-family: Times New Roman; line-height: normal; color: rgb(0, 0, 0); font-size: medium; font-style: normal">
      <font size="3" face="SansSerif">Around 1995 or 1996&#xa0;<a href="ftp://ftp.yggdrasil.com/">Yggdrasil</a>&#xa0;had jurix together with some other distros on one of their CD-ROMs. They never emailed me about that nor have I seen actually one of those CD-ROMs, so I don't know how stable that snapshot was. :-) </font>
    </p>
    <p style="font-variant: normal; text-transform: none; font-weight: normal; white-space: normal; word-spacing: 0px; letter-spacing: normal; text-indent: 0px; text-align: start; font-family: Times New Roman; line-height: normal; color: rgb(0, 0, 0); font-size: medium; font-style: normal">
      <font size="3" face="SansSerif">LST 1.0 was also based on jurix. They even used the binaries from a jurix mirror, but repackaged some other things like man-pages. </font>
    </p>
    <p style="font-variant: normal; text-transform: none; font-weight: normal; white-space: normal; word-spacing: 0px; letter-spacing: normal; text-indent: 0px; text-align: start; font-family: Times New Roman; line-height: normal; color: rgb(0, 0, 0); font-size: medium; font-style: normal">
      <font size="3" face="SansSerif">Since october 1995 I am paid by SuSE. Until then they used to sell a modified Slackware. Jurix was used as a fresh start and I have done most of the work for the first release of SuSE 4.2 in april 1996. The 4.x series of SuSE were closely coupled with jurix and many people liked the stability and design of the basic system. SuSE has added lots of new packages to make the CD-ROMS more complete and spend some time to add good documentation. YaST helps novice users and also more experienced ones a lot. </font>
    </p>
    <p style="font-variant: normal; text-transform: none; font-weight: normal; white-space: normal; word-spacing: 0px; letter-spacing: normal; text-indent: 0px; text-align: start; font-family: Times New Roman; line-height: normal; color: rgb(0, 0, 0); font-size: medium; font-style: normal">
      <font size="3" face="SansSerif">I have started my own update tool at the end of 1996. It has until now only the few things that I need myself for updating my server machines and compiling the source packages in a chroot-envionment. If someone would support further development, I am sure this could result in a very powerful and flexibel tool. Per default, the binary packages are still in .tgz format, but I also wouldn't mind if someone comes up with a working tgz-&gt;rpm converter and offers jurix with the Red Hat install disks and rpm packages. </font>
    </p>
    <table width="100%">
      <tr>
        <td align="left">
          <address>Copyright (C) 1999 by&#xa0;<a href="mailto:florian@jurix.org?Subject=Jurix%20Linux">Florian La Roche</a></address>
        </td>
      </tr>
    </table>
  </body>
</html></richcontent>
