<node CREATED="1407874240887" ID="ID_1946975922" MODIFIED="1407874256828" TEXT="About Burapha Linux Server">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Burapha Linux Server is a free Linux distribution. It is a descendant of Burapha Linux 5.5, which in turn was a descendant of Slackware 10.x. Burapha Linux Server does not have any packages taken directly from Slackware; the project builds their own packages and have their own package manager. The primary purpose of development is for the computer science students to learn the infrastructure of a UNIX system, and to apply the acquired knowledge in research and projects.&#xa0;
    </p>
  </body>
</html></richcontent>
