  <body>
    <p>
      Alpine Linux is a Linux distribution based on musl and BusyBox, which has the goal of being lightweight and secure by default while still being useful for general-purpose tasks. Alpine Linux uses PaX and grsecurity patches in the default kernel and compiles all packages with stack-smashing protection. It is primarily designed for x86 routers, firewalls, VPNs, VoIP and servers.
