<node CREATED="1401831972457" FOLDED="true" ID="ID_123638994" MODIFIED="1429355991261" TEXT="info">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      CRUX is a lightweight, i686-optimised Linux distribution targeted at experienced Linux users. The primary focus of this distribution is &quot;keep it simple&quot;, which is reflected in a simple tar.gz-based package system, BSD-style initscripts, and a relatively small collection of trimmed packages. The secondary focus is utilization of new Linux features and recent tools and libraries.
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=crux
    </p>
  </body>
</html></richcontent>
