<node CREATED="1409678113299" ID="ID_333047503" MODIFIED="1409678126607" TEXT="About Foresight Linux">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Foresight Linux is a desktop operating system, based on rPath Linux, featuring an intuitive user interface and showcasing the latest desktop software. As a Linux distribution, Foresight sets itself apart by eliminating the need for the user to be familiar with Linux, combining a user-focused desktop environment on top of the Conary package management system. As the most technically innovative software management system available today, Conary ensures that users can efficiently search, install, and manage all the software on the Foresight system, including bringing in the latest features and fixes without waiting for a major release.&#xa0;<br/>
    </p>
  </body>
</html></richcontent>
