<node CREATED="1409682488536" ID="ID_962750345" MODIFIED="1409682525729" TEXT="About GeeXboX">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      GeeXboX is a free and open-source media centre oriented Linux distribution for embedded devices and desktop computers. It is a full-featured operating system that can be booted from a live CD, a USB key, an SD/MMC card or it can be installed on a regular hard disk drive. The GeeXboX distribution is lightweight and designed for one single goal - to embed all major multimedia applications in order to turn any computer into a home theatre personal computer. The GeeXboX project is a non-commercial organization founded in 2002.&#xa0;
    </p>
  </body>
</html></richcontent>
