<node CREATED="1402187223811" FOLDED="true" ID="ID_646461481" MODIFIED="1429355991265" TEXT="About GoboLinux">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      GoboLinux is a modular Linux distribution - it organizes the programs in a new, logical way. Instead of having parts of a program thrown at /usr/bin, other parts at /etc and yet more parts thrown at /usr/share/something/or/another, each program gets its own directory tree, keeping them all neatly separated and allowing the user to see everything that's installed in the system and which files belong to which programs in a simple and obvious way.&#xa0;
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=gobo
    </p>
  </body>
</html></richcontent>
