  </head>
  <body>
    <p>
      Maui is a Linux-based operating system, a suite of software that makes your computer run. You can use the Maui operating system to replace or to run alongside of other operating systems such as Microsoft Windows&#8482; or Mac OS X&#8482; although it's not currently considered as stable as other operating systems, if you feel brave enough you can be an early adopter and let us know of glitches and bugs and help us make a great product.
