<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      openmamba GNU/Linux is a distribution for personal computers (Intel i686-compatible) that can be used on notebooks, desktops and servers. It works as an installable live CD, offering out-of-the box support for proprietary graphics drivers and wireless network cards, a variety of media codecs and 3D desktop with KDE. The distribution, which has roots in the discontinued QiLinux project, uses APT for RPM and Synaptic as its package management tools.&#xa0;
