<node CREATED="1402007594337" FOLDED="true" ID="ID_1945302311" MODIFIED="1429355991270" TEXT="About PCLinuxOS">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      PCLinuxOS is a user-friendly Linux distribution with out-of-the-box support for many popular graphics and sound cards, as well as other peripheral devices. The bootable live CD provides an easy-to-use graphical installer and the distribution sports a wide range of popular applications for the typical desktop user, including browser plugins and full multimedia playback. The intuitive system configuration tools include Synaptic for package management, Addlocale to add support to many languages, Getopenoffice to install the latest OpenOffice.org, and Mylivecd to create a customised live CD.&#xa0;
    </p>
    <p>
      
    </p>
    <p>
      (c) http://distrowatch.com/table.php?distribution=pclinuxos
    </p>
  </body>
</html></richcontent>
