<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      PLD Linux Distribution is a free, RPM-based Linux distribution, aimed at the more advanced users and administrators, who accept the trade-offs of using a system that might require manual tweaking in exchange for flexibility. Simultaneous support for a wide variety of architectures and non-conservative approach to RPM usage provide the users with a consistent environment on almost all available architectures.&#xa0;
