<node CREATED="1408913429856" ID="ID_1891777802" MODIFIED="1410905018567" TEXT="About Linar Linux">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Lunar is a source based Linux distribution with a unique package management system which builds each software package, or module, for the machine it is being installed on. Though it can take a while to do a complete Lunar installation it's worth it as it tends to be quite fast, once installed! In the beginning Lunar was a fork of Sorcerer GNU Linux (SGL). The fork occurred in late January to early February of 2002 and was originally made up of a small group of people who wanted to collaboratively develop and extend the Sorcerer technology. The original name for the project was Lunar-Penguin but the group decided to re-christen it Lunar Linux while the Lunar-Penguin name has become a sort of umbrella which the team could use if they decide to collaboratively develop something besides Lunar Linux.&#xa0;
    </p>
  </body>
</html></richcontent>
<font BOLD="true" NAME="SansSerif" SIZE="12"/>
</node>
</node>
<node CREATED="1410905114261" FOLDED="true" ID="ID_1396491366" LINK="http://www.sourcemage.org/" MODIFIED="1429355991273" TEXT="Source Mage GNU/Linux">
<node CREATED="1411337259829" ID="ID_1355331346" MODIFIED="1411337274878" TEXT="About SMGL">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Source Mage is a source-based GNU/Linux distribution based on a Sorcery metaphor of &quot;casting&quot; and &quot;dispelling&quot; programs, which we refer to as &quot;spells&quot;, and a package manager called &quot;Sorcery&quot;. Our packages are designed to allow the user to customize the package any way they want (custom CFLAGS, LDFLAGS, ./configure flags, etc.) as well as offering as many of the package options as possible to the user up-front (you will not need to know what options a package has or what optional dependencies it can use ahead of time). All of our scripts are GPL'd and our package manager and packages are written in bash, so they are easy to learn and modify. Sorcery supports custom packages maintained by users, which can override the default package and will never be touched by updates. The magic is truly in your hands with Source Mage.
    </p>
  </body>
</html></richcontent>
<font BOLD="true" NAME="SansSerif" SIZE="12"/>
</node>
</node>
