<node CREATED="1411244408469" ID="ID_1751823929" MODIFIED="1411244496898" TEXT="About THL">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p http-equiv="content-type" content="text/html; charset=utf-8" style="word-spacing: 0px; margin-left: 0px; font-weight: normal; margin-top: 0; letter-spacing: normal; background-color: rgb(255, 255, 255); text-transform: none; margin-bottom: 0; font-family: sans-serif; white-space: normal; font-variant: normal; color: rgb(37, 37, 37); text-align: start; text-indent: 0px; font-style: normal; line-height: 22.3999996185303px; font-size: 14px; margin-right: 0px">
      Tinfoil Hat Linux(THL) is a compactSecurity-focusedLinux distributiondesigned for highsecuritydeveloped by theShmoo Group. The first version (1.000) was released in February 2002. It appears to be a low priority project as of 2013. Its image files and source are available ingzipformat. THL can be used on almost any modernPC, as it requires aIntel 80386or better computer, with at least 8MBofRAM. The distribution fits on a singleHD floppy. The small footprint provides additional benefits beyond making the system easy to understand and verify- the computer need not even have ahard drive, making it easier to &quot;sanitize&quot; the computer after use.
    </p>
    <p style="word-spacing: 0px; margin-left: 0px; font-weight: normal; margin-top: 0; letter-spacing: normal; background-color: rgb(255, 255, 255); text-transform: none; margin-bottom: 0; font-family: sans-serif; white-space: normal; font-variant: normal; color: rgb(37, 37, 37); text-align: start; text-indent: 0px; font-style: normal; line-height: 22.3999996185303px; font-size: 14px; margin-right: 0px">
      The logo of Tinfoil Hat isTux, the Linux mascot, wearing atinfoil hat.
    </p>
  </body>
</html></richcontent>
</node>
</node>
