<node CREATED="1411690347160" ID="ID_709019343" MODIFIED="1456018975609" TEXT="info">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      illumosis afree and open-sourceUnixoperating system. It derives fromOpenSolaris, which in turn derives fromSVR4UNIXandBerkeley Software Distribution(BSD). illumos comprises akernel,device drivers, systemlibraries, andutility softwareforsystem administration. This core forms the basis of several operating system distributions (see below). illumos has a similar role as theLinuxkernel, which forms the basis for differentGNU/Linux distributions. Thus, after thede factodemise of theopen-sourceOpenSolaris project there are different open-sourcedOpenSolaris distributionsnow based on the illumos kernel.
    </p>
  </body>
</html></richcontent>
