<node CREATED="1412705382383" FOLDED="true" ID="ID_614904358" LINK="http://osdyson.org/projects/dyson/wiki" MODIFIED="1429355991277" TEXT="Dyson">
<node CREATED="1412705394016" ID="ID_654890037" MODIFIED="1412705493178" TEXT="About Dyson">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Dyson is a general-purpose operating system, aDebianderivative using theillumoskernel, libc, and SMF init system (formerly OpenSolaris).
    </p>
    <p>
      It is not a successor of any existing or existed distributions based on illumos or OpenSolaris. Dyson is constructed from scratch to be like Debian as much as possible. Namely, most of Debian packages can bebuilt on Dysonwithout any changes, and arch-independent packages (archallin Debian terms) can be installed directly as is.
    </p>
  </body>
</html></richcontent>
