<node CREATED="1411690090780" ID="ID_1042807030" MODIFIED="1411690419354" TEXT="About OpenIndiana">
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>
    <p>
      OpenIndiana is a continuation of the OpenSolaris operating system. It was conceived during the period of uncertainty following the Oracle takeover of Sun Microsystems, after several months passed with no binary updates made available to the public. The formation proved timely, as Oracle discontinued OpenSolaris soon after in favour of Solaris 11 Express, a binary distribution with a more closed development model to d&#233;but later this year. OpenIndiana is part of the Illumos Foundation, and provides a true open-source community alternative to Solaris 11 and Solaris 11 Express, with an open development model and full community participation.
    </p>
  </body>
</html></richcontent>
</node>
